response.about:
Скучен, зануден, стар... лишний вес, давление, облысение, близорукость (или дальнозоркость?)... А!..Склероз! ищу работу... не люблю шутки. Петь люблю, но не умею. Поэтому пою громко. 
Ветер в голове, да и не только в голове; 
Я за любой кипеж, кроме голодовки; 
Скучную работу не предлагать, тяжёлую - тоже. 
Деньги в виде взяток готов брать, но буду стесняться некоторое время.
